    public Vector3ListsEvent drawGeometryEvent;

    List<Dictionary<string, object>> propertyList = new List<Dictionary<string, object>>();

    void Start()
    {

        GeoJSON geojson = new GeoJSON(testdata);
        float count = 0;
        while (geojson.GotoNextFeature())
        {
            count++;

            var polygons = geojson.GetPolygon();
            var properties = geojson.GetProperties();
            propertyList.Add(properties);

            foreach(var polygon in polygons)
            {
                List<IList<Vector3>> polyList = new List<IList<Vector3>>();
                List<Vector3> list = new List<Vector3>();
                foreach (var point in polygon)
                {
                    var p = ConvertCoordinates.CoordConvert.WGS84toUnity(point.x, point.y);
                    p.y = count;
                    list.Add(p);
                }
                polyList.Add(list);
                drawGeometryEvent.started?.Invoke(polyList);
            }

        }


        }


    void Update()
    {
        if( Input.GetMouseButtonDown(0))
        {
            RaycastHit hit;
            Ray ray = CameraModeChanger.Instance.ActiveCamera.ScreenPointToRay(Input.mousePosition);

            if (Physics.Raycast(ray, out hit))
            {
                var name = hit.transform.name;
                //Debug.Log( $"hit: {hit.transform.name}");

                if (name.StartsWith("polygonindex_"))
                {

                    PropertiesPanel.Instance.OpenObjectInformation("Object informatie", clearOldfields:true);

                    var id = int.Parse(name.Split('_')[1]);
                    var properties = propertyList[id];

                    foreach(var kv in properties)
                    {
                        PropertiesPanel.Instance.AddDataField(kv.Key, kv.Value.ToString());                        
                    }
                    
                }





            }
        }
        

    }
